import React from "react";

class ChooseOperation extends React.Component {
    getOperation(){
        return this.props.Operation.value;
    }

    render() {
        return (
            <div class="Choose operation">
                <select name="Operation" id="CC" class="form-control">
                    <option>Calculator</option>
                    <option>Converter</option>
                </select>
            </div>
        );
    }
}

export default ChooseOperation;
